import React, { Component } from "react";
import axios from 'axios'

export default class App extends Component {

constructor(props){
  super(props);
this.state={
  lab:[]
};

}

componentDidMount(){
  this.retriveReports();
}

retriveReports(){
  axios.get("http://localhost:8000/lab").then(res =>{

  if(res.data.success){
    this.setState({
      lab:res.data.existingLab
    });

    console.log(this.state.lab)
  }

  });
}

  render() {
    return(
      <div>
        <p>Laboratory Management System</p>
        {this.state.lab.map(lab =>(
          <div>
          <p>{lab.name}</p>
          <p>{lab.nic}</p>
          <p>{lab.age}</p>
          <p>{lab.sex}</p>
          <p>{lab.type}</p>
          <p>{lab.result}</p>
          <p>{lab.date}</p>
          <p>{lab.status}</p>
          </div>
        ))}
      </div>
    )
  }
}
